المقادير 🌺
.
٢/٣ كوب بياض بيض ( ٦ بياض بيض لوصغير ) ( وأذا كبير ٣بياض بيض )
نص كوب جبن قريش ( ١٠٠ جرام )
ملعقه صغيره بكنج بودر
طرف سكر ستيفيا
نص ملعقه كبيره خميره فوريه
ربع ملعقة صغيره ملح
٤ ملاعق كبيره سليلليوم ( أسباغول )
٢ملعقه كبيره زبده طبيعي
لتزيين سمسم وحبة البركه وشمر حسب الرغبه
.
الطريقه 🌺
.
في الخلاط نضع بياض البيض
والجبن والبكنج بودر
والخميره والملح والسكر والخل ونخلط جيدا
نصب الخليط في وعاء ونضيف السيلليوم ونخلط بالملعقه ونضيف الزبده ونخلط
تكور كرات وأشكال صامولي صغير وتوضع على ورقة زبده مدهونه سمن علشان مايلصق الخبز في صينية فرن
نضع السمسم وحبة البركه والشمر
تخبز في فرن حار على درجة ١٩٠ في الرف الأوسط
من أسفل وبعدين فوق
يحشى بالحشوه حسب الرغبه ويقدم وصحتين وعافيه
.
ملحوظه 🌺
.
بديل الجبن الأبيض جبن كريمي نفس المقدار أو جبن كيري ٨ حبات لاكن نحذف الزبده ونضيف ٢ملعقه كبيره زيت زيتون
واتبعو الخطوات والمقادير علشان يظبط معاكم
ممكن بديل ٤ملاعق سيلليوم 🌺
نضيف ٢ملعقه كبيره سيلليوم + ٢ملعقه كبيره دقيق جوز الهند لأن السليللوم بيعمل على تماسك العجينه .
